import React from "react";
import Header from "../Components/Header";
import SkillChart from "../Components/SkillsChart"
import FlipCard from "../Components/FlipCard"
import {Flowpoints, Flowspace} from 'flowpoints';
import Flowpoint from "flowpoints/dist/Flowpoint";
// MAKE FLOW CHART FROM FLOWPOINTS LIBRARY OF DIFFERENT TECH AND SHIT YOU KNOW


function SkillPage(props) {
    var data = {
        datasets: [{
            label: 'Programming languages',
            data: [100,70,80],
            backgroundColor: ['Blue','Yellow','Red'],
            hoverBackgroundColor: ['Light blue', 'light yellow', 'pink']
        }],
        labels : ['Python','Java','Unix'],

    }
    var data1 = {
        datasets: [{
            label: 'Programming languages',
            data: [100,70,80],
            backgroundColor: ['Blue','Yellow','Red'],
            hoverBackgroundColor: ['green', 'orange', 'pink']
        }],
        labels : ['What','the','fuck'],

    }
    return  (
        <div className = "s-progLang">
            <SkillChart chartData = {data} />
            <Flowspace
                theme= 'red'
            >
                <Flowpoint key ="point_a" outputs={["point_b"]}>
                    Yo this is 
                </Flowpoint>
                <Flowpoint key="point_b">
                    CRAZY
                </Flowpoint>
            </Flowspace>
        </div>

    )
}

export default SkillPage
